    false,nt"url": null,nt"notes": "These data were collected by the SHOALS-1000T(Scanning
    Hydrographic Operational Airborne Lidar Survey)system which consists of an airborne
    laser transmitter/receiver with a 1kHz. bathymetric laser and a10 kHz topographic
    laser. The system was operated from a Beechcraft King Air 90aircraft. Data were
    collected with the bathymetric laser while flying at altitudes of about 400 meters
    and a groundspeed of about 124 knots. The topographic laser data was collected at
    altitudes of about 700 m and a groundspeed of 150 kts. One KGPS base stations was
    used during processing of the dataset. The SHOALS system includes a ground-based
    data processing system for calculating accurate horizontal position and water depth
    / elevation. LIDAR is an acronym for LIght Detection And Ranging. The system operates
    by emitting a pulse of light that travels from an airborne platform to the water
    surface where a small portion of the laser energy is backscattered to the airborne
    receiver. The remaining energy at the wateru0092s surface propagates through the
    water column and reflects off the sea bottom and back to the airborne detector.
    The time difference between the surface return and the bottom return corresponds
    to water depth. The maximum depth the system is able to sense is related to the
    complex interaction of radiance of bottom material, incident sunangle and intensity,
    and the type and quantity of organics or sediments in the water column. As a rule-of-thumb,
    the SHOALS 1000 system is capable of sensing bottom to depths equal to two or three
    times the Secchi depth. Topographic elevations are gridded in this dataset.",nt"owner_org":
